  wrapper: {
    margin: 0,
    hight: "100%"
  },
  box: {
    border: "solid 3px #000000",
    boxSizing: "border-box",
    padding: "0.5em 1em",
    marginLeft: "8em",
    marginRight: "8em",
  }
});

const Aboutme=()=>{
  const classes = useStyles();
  
  return(
    <div className={classes.wrapper}>
      <Grid container alignItems="center" justify="center">
        <Grid item xs={10}>
          <div className={classes.box}>
            aaa
          </div>
        </Grid>
        
      </Grid>
    </div>    
  );
}
export default Aboutme;
